import React from 'react';
import Home from './screens/home';
import * as Font from 'expo-font';

const getFonts = () => {
  return Font.loadAsync(
    {
      'Roboto': require('./assets/fonts/Roboto-Regular.ttf')
    }
  );
}


export default function App() {
  return (
    <Home />
  );
}
